INSERT INTO `movies` VALUES (27262245,'INTERSTELLAR','13+',169,' Adventure , Drama ,Sci-Fi','When Earth becomes uninhabitable in the future, a farmer and ex-NASA pilot, Joseph Cooper, is tasked to pilot a spacecraft, along with a team of researchers, to find a new planet for humans.','Christopher Nolan',6),(406074060,'THE GODFATHER','18+',175,'Crime,Drama','Don Vito Corleone, head of a mafia family, decides to hand over his empire to his youngest son Michael. However, his decision unintentionally puts the lives of his loved ones in grave danger.','Francis Ford Coppola',6),(956215345,'EVIL DEAD RISE','18+',96,'Horror','A twisted tale of two estranged sisters whose reunion is cut short by the rise of flesh-possessing demons, thrusting them into a primal battle for survival as they face the most nightmarish version of family imaginable.','Lee Cronin',3),(1192729815,'THE GODFATHER PART II','18+',202,'Crime,Drama','The early life and career of Vito Corleone in 1920s New York City is portrayed, while his son, Michael, expands and tightens his grip on the family crime syndicate.','Francis Ford Coppola',3),(1290010663,'SMILE','18+',115,'Horror','After witnessing a bizarre, traumatic incident involving a patient, a psychiatrist becomes increasingly convinced she is being threatened by an uncanny entity.',' Parker Finn',3);
